import { useState } from "react";
import "./App.css";
import Footer from "./Components/Footer";

import Navbar from "./Components/Navbar";
function App() {
  const [light, SetLight] = useState(false);
  return (
    <div className="App">
      <header className="App-header">
        <Navbar SetLight={SetLight} light={light} />
        <div className="image">
          <img src="./img/lamp.png" className="lamp" />
          <img src="./img/light.png" className={light ? "light on" : "light"} />
        </div>
        <div className="text">
          <h2>Super NFT Market</h2>
          <div className="text_test">
            <p>
              Transactions through our market increase users' assets than
              before.
            </p>
            <span>Increase your assets through various NFT transactions</span>
          </div>
        </div>
      </header>

      <Footer />
    </div>
  );
}

export default App;
